import React from "react";
import "./index.css";
import Naat from "./Naat";
import Ndata from "./Ndata";

function ncard(val) {
  return (
    <App
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
}

ReactDOM.render(
  <>
    <h4 className="heading_style">5 Good Naats </h4>
    {Ndata.map(ncard)}
  </>,
  document.getElementById("root")
);
